                <header className="header">CONNECT 4 GAME</header>

                <p onClick={() => setChange(!change)}>
                    Snap a rubber band on your wrist every time you have a bad thought.
                </p>

                {
                    change?
                        <div>
                            <p>hi</p>
                        </div>
                        :null
                }
            </div>
        </>
    )
}

export default App;
